// App.js

import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import NavBar from "./component/Navbar/Navbar";
import About from "./components/About/About";
import FindTheOne from "./components/FindTheOne/FindTheOne";
import FavoritCards from "./components/FavoritCards/FavoritCards";
import Register from "./components/Register/Register";
import MyCards from "./components/Cards/Cards";
import SandBox from "./components/SandBox/SandBox";
import Footer from "./components/Footer/Footer";
import { ThemeProvider } from "./hooks/DarkMode/DarkModeContext";
import { UserProvider } from "./hooks/UserHooks/userContextApp";
import "./hooks/DarkMode/DarkMode.css";

const App = () => {
  return (
    <ThemeProvider>
      <UserProvider>
        <BrowserRouter>
          <NavBar />
          <Routes>
            <Route path="/" element={<About />} />
            <Route path="/FindTheOne" element={<FindTheOne />} />
            <Route path="/favCards" element={<FavoritCards />} />
            <Route path="/myCards" element={<MyCards />} />
            <Route path="/register" element={<Register />} />
            <Route path="/sandBox" element={<SandBox />} />
          </Routes>
          <Footer />
        </BrowserRouter>
      </UserProvider>
    </ThemeProvider>
  );
}

export default App;
